function validateDominicanId(t){if(!t)return!1;if(!(11===(t=(t=t.replaceAll("-","")).trim()).length))return!1;if("000"===t.substr(0,3))return!1;let r=0;const e=parseInt(t.substr(10,1));for(let e=0;e<10;e++){let n=parseInt(t.substr(e,1))*parseInt("1212121212".substr(e,1));if(n>9){const t=n.toString();n=parseInt(t.charAt(0))+parseInt(t.charAt(1))}r+=n}return(10-r%10)%10===e}module.exports=validateDominicanId;